function verificarDDD(numero) {
    // Verificar se o número tem pelo menos 11 dígitos
    if (numero.length < 11) {
        return "Número de telefone inválido";
    }

    // Extrair os três primeiros dígitos (DDD)
    var ddd = numero.substring(2, 4);

    // Verificar se o DDD é igual a 62
    if (ddd === '62') {
        return "sim";
    } else {
        return "não";
    }
}

